import{_ as t,c as e,o as r,ax as a}from"./chunks/framework.C8BuEDzu.js";const k=JSON.parse('{"title":"BukkitSpring 是什么?","description":"","frontmatter":{},"headers":[],"relativePath":"doc/info/what_is_bukkit_spring.md","filePath":"doc/info/what_is_bukkit_spring.md","lastUpdated":1714133852000}'),i={name:"doc/info/what_is_bukkit_spring.md"},n=a('<h1 id="bukkitspring-是什么" tabindex="-1">BukkitSpring 是什么? <a class="header-anchor" href="#bukkitspring-是什么" aria-label="Permalink to &quot;BukkitSpring 是什么?&quot;">​</a></h1><p>BukkitSpring 是一个 Bukkit 插件，融入了 SpringBoot ，使得你可以在 Bukkit 插件中使用 SpringBoot 的特性与生态。</p><h2 id="使用场景" tabindex="-1">使用场景 <a class="header-anchor" href="#使用场景" aria-label="Permalink to &quot;使用场景&quot;">​</a></h2><p>本项目定位是 <strong>To B</strong> 项目，面向的是各个服务器的<strong>开发团队</strong>。 为你的团队提供一个强有力的开发框架， 帮助你减少例如 MySQL Redis 等中间件带来的开发心智负担。</p><p>并且本项目可以完美兼容 TabooLib 并基于其特性进行拓展。</p><h2 id="目前已整合的第三方框架-中间件-工具" tabindex="-1">目前已整合的第三方框架 中间件 工具 <a class="header-anchor" href="#目前已整合的第三方框架-中间件-工具" aria-label="Permalink to &quot;目前已整合的第三方框架 中间件 工具&quot;">​</a></h2><table><thead><tr><th style="text-align:center;">框架名称</th><th style="text-align:center;">项目地址</th><th style="text-align:center;">介绍</th><th style="text-align:center;">备注</th></tr></thead><tbody><tr><td style="text-align:center;">Redis</td><td style="text-align:center;"><a href="https://redis.io/" target="_blank" rel="noreferrer">https://redis.io/</a></td><td style="text-align:center;">提供了缓存与广播方案</td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">Redisson</td><td style="text-align:center;"><a href="https://redisson.pro/" target="_blank" rel="noreferrer">https://redisson.pro/</a></td><td style="text-align:center;">高性能Redis客户端</td><td style="text-align:center;"></td></tr><tr><td style="text-align:center;">MybatisPlus</td><td style="text-align:center;"><a href="https://baomidou.com/" target="_blank" rel="noreferrer">https://baomidou.com/</a></td><td style="text-align:center;">Mybatis增强工具</td><td style="text-align:center;">项目内提供为多数据源配置 如需动态切换需搭配Kotlin-Expansion</td></tr><tr><td style="text-align:center;">PageHelper</td><td style="text-align:center;"><a href="https://pagehelper.github.io/" target="_blank" rel="noreferrer">https://pagehelper.github.io/</a></td><td style="text-align:center;">对Mybatis查询的数据进行分页</td><td style="text-align:center;"></td></tr></tbody></table><h2 id="开发体验" tabindex="-1">开发体验 <a class="header-anchor" href="#开发体验" aria-label="Permalink to &quot;开发体验&quot;">​</a></h2><p>如果 你是一个从业于 Java 后端开发的<strong>专业</strong>开发者，那么你对 SpringBoot 一定不会陌生 在这里你可以获得到与 SpringBoot 一致的开发体验。</p><blockquote><p>如果并无 SpringBoot 的开发经验 就请不要使用本框架 这会大大的增加你的开发负担</p></blockquote><ul><li>MybatisPlus: 使用注解开发 Mapper,Service,Entity 来实现你的 ORM 开发! 告别传统的JDBC</li><li>SpringCache: 利用注解来快捷的与 Redis 产生交互 对数据进行管理 ...</li></ul><p>还有更多! 剩下的就由你的团队 一起自定义吧。我们已经导入了常见的工具并封装。</p><p>如果团队有特殊需求可以<strong>自行导入并管理</strong> <em>(出现兼容问题BukkitSpring并不负主要责任无义务指导)</em>。</p>',13),s=[n];function o(l,d,p,h,c,g){return r(),e("div",null,s)}const u=t(i,[["render",o]]);export{k as __pageData,u as default};
